import React, { useState, useEffect, useContext } from 'react';
import {
  Box,
  Paper,
  Typography,
  Button,
  Card,
  CardContent,
  Grid,
  Fab,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField,
  Alert,
} from '@mui/material';
import { Add as AddIcon, LocalFlorist as PlantIcon } from '@mui/icons-material';
import { UserContext } from '../contexts/UserContext';

const PlantList = () => {
  const [plants, setPlants] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [open, setOpen] = useState(false);
  const [newPlant, setNewPlant] = useState({
    name: '',
    species: '',
    plantingDate: '',
    notes: ''
  });
  const { token } = useContext(UserContext);

  const fetchPlants = async () => {
    try {
      const response = await fetch('/api/plants', {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });

      if (response.ok) {
        const data = await response.json();
        setPlants(data);
      } else {
        setError('Failed to fetch plants');
      }
    } catch (err) {
      setError('Error connecting to server');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (token) {
      fetchPlants();
    }
  }, [token]);

  const handleAddPlant = async () => {
    try {
      const response = await fetch('/api/plants', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`,
        },
        body: JSON.stringify(newPlant),
      });

      if (response.ok) {
        setOpen(false);
        setNewPlant({ name: '', species: '', plantingDate: '', notes: '' });
        fetchPlants(); // Refresh the list
      } else {
        setError('Failed to add plant');
      }
    } catch (err) {
      setError('Error adding plant');
    }
  };

  if (loading) return <Typography>Loading plants...</Typography>;

  return (
    <Box>
      <Paper elevation={1} sx={{ p: 3, mb: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom sx={{ color: 'primary.dark' }}>
          ðŸŒ± My Plants
        </Typography>
        <Typography variant="body1" color="textSecondary">
          Manage your plant collection and track their growth
        </Typography>
      </Paper>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      <Grid container spacing={3}>
        {plants.map((plant) => (
          <Grid item xs={12} sm={6} md={4} key={plant.id}>
            <Card elevation={2}>
              <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                  <PlantIcon sx={{ color: 'primary.main', mr: 1 }} />
                  <Typography variant="h6" component="h2">
                    {plant.name}
                  </Typography>
                </Box>
                <Typography color="textSecondary" gutterBottom>
                  Species: {plant.species}
                </Typography>
                {plant.plantingDate && (
                  <Typography color="textSecondary" gutterBottom>
                    Planted: {new Date(plant.plantingDate).toLocaleDateString()}
                  </Typography>
                )}
                {plant.notes && (
                  <Typography variant="body2">
                    {plant.notes}
                  </Typography>
                )}
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      {plants.length === 0 && !loading && (
        <Paper sx={{ p: 4, textAlign: 'center', mt: 4 }}>
          <PlantIcon sx={{ fontSize: 60, color: 'primary.light', mb: 2 }} />
          <Typography variant="h6" gutterBottom>
            No plants yet!
          </Typography>
          <Typography color="textSecondary">
            Start your garden by adding your first plant.
          </Typography>
        </Paper>
      )}

      <Fab
        color="primary"
        aria-label="add plant"
        sx={{ position: 'fixed', bottom: 16, right: 16 }}
        onClick={() => setOpen(true)}
      >
        <AddIcon />
      </Fab>

      <Dialog open={open} onClose={() => setOpen(false)} maxWidth="sm" fullWidth>
        <DialogTitle>Add New Plant</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            label="Plant Name"
            fullWidth
            variant="outlined"
            value={newPlant.name}
            onChange={(e) => setNewPlant({ ...newPlant, name: e.target.value })}
            sx={{ mb: 2 }}
          />
          <TextField
            margin="dense"
            label="Species"
            fullWidth
            variant="outlined"
            value={newPlant.species}
            onChange={(e) => setNewPlant({ ...newPlant, species: e.target.value })}
            sx={{ mb: 2 }}
          />
          <TextField
            margin="dense"
            label="Planting Date"
            type="date"
            fullWidth
            variant="outlined"
            InputLabelProps={{ shrink: true }}
            value={newPlant.plantingDate}
            onChange={(e) => setNewPlant({ ...newPlant, plantingDate: e.target.value })}
            sx={{ mb: 2 }}
          />
          <TextField
            margin="dense"
            label="Notes"
            fullWidth
            multiline
            rows={3}
            variant="outlined"
            value={newPlant.notes}
            onChange={(e) => setNewPlant({ ...newPlant, notes: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpen(false)}>Cancel</Button>
          <Button onClick={handleAddPlant} variant="contained">
            Add Plant
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default PlantList;
